const TableBody = (props) => {
  let x = props.score.scores.sort((a, b) => a.s - b.s);
  return (
    <tbody>
      {props.elem.scores.map((score, index) => (
        <tr className="border_bottom" key={index}>
          <td>{x.n}</td>
          <td>{x.s}</td>
        </tr>
      ))}
    </tbody>
  );
};
export default TableBody;
